import styled, {keyframes} from 'styled-components'

export const PaymentContainer = styled.div`
        width: 980px;
        height: 100%;
        display: flex;
        flex-direction: column;
`;


export const InputBlock = styled.div`
        display: flex;
        flex-direction: column;
`;
